title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o10112.m27 -> o10109.m28 -> o10112.m19 -> o10109.m28
  o10112.m0 -> o10109.m28 -> o10112.m19 -> o10109.m28
  o10112.m14 -> o10112.m19 -> o10109.m28 -> o10112.m19
  o10112.m19 -> o10109.m28 -> o10112.m19
  o10112.m9 -> o10109.m28 -> o10112.m19 -> o10109.m28
  o10109.m28 -> o10112.m19 -> o10109.m28
  o10112.m29 -> o10109.m28 -> o10112.m19 -> o10109.m28
  o10112.m2 -> o10109.m28 -> o10112.m19 -> o10109.m28

features:
  - inheritance
  - overriding
  - method
  - polymorphism

